textDisplay:
@Руслан Логунов .
В чём мне позор? В том что я выражаю своё мнение.
И что тут оскорбительного?

@Нина Бердяева Повоевал, молодец, если повоевал, а не из лжеветерано, которых развелось сейчас, как клопов.  
 Если выступает  как  гражданин, пусть и выступает, как гражданин, а не спекулирует своим ветеранством. 
Интересно, а в 1887 году отмечали 75 годовщину победы над Наполеоном?

@Нина Бердяева 
В исключениях перечислено, когда отчуждать можно - делимитация, демаркация, редемаркация.  Или в ваших поправках исключений нет?   
ст.67 ч. 2-1 Действия  за исключением делимитации,  демаркации, редемаркации государственной границы Российской Федерации с сопредельными государствами), направленные на отчуждение части территории Российской Федерации, а также призывы к таким действиям не допускаются

@Нина Бердяева Я не про навального. Вы уверены, что дед читал поправки? Уверены, что понял, о чем там речь?
Лживость буквально с первой страницы: б) дополнить частью 21 следующего содержания:
«21. Российская Федерация обеспечивает защиту своего суверенитета и территориальной целостности. Действия (за исключением делимита-ции, демаркации, редемаркации государственной границы Российской Федерации с сопредельными государствами), направленные на отчуждение части территории Российской Федерации, а также при-зывы к таким действиям не допускаются.»;
А нам рассказывыают, что  земли отдать невозможно будет. Ага, так точно.  Провели демаркацию с китаем и отдали три острова, в том числе тарабаров и даманский.
Проведут демаркацию и отдадут японцам курилы, а нам свистят, что голосните и это станет невозможно. Ложь.

@Илистое дно Привет, дно)).
1. Откуда столько ветеранов? Большинство воевали не в 18, а им было уже по 20-30 лет. Т.е. сейчас большинству ветеранов уже за 100. У нас людей с таким возрастом единицы.
2. Их никто не называл предателями.

@Ирина Михайленко Не надо врать - за отдельную поправку проголосовать нельзя .
К тому-же они вступили в законную силу.
Можно только поучаствовать в шапито - на потеху царьку.

@Светлана Гильдеева Придумывать что-то про собеседника и безапелляционным тоном рассказывать ему о нем же самом - ещё одна глупость, такая знакомая. Браво, Шерлок, вы меня раскусили!
Теперь мне легче понять, почему вы не слышите никаких доводов: вам проще и удобнее жить в придуманной  реальности. На все вопросы всегда есть ответ, и некомфортная мысль, что вы можете быть не правы, не беспокоит. 

Но я всё это говорю лишь потому, что хочу сделать великую Россию сырьевым придатком запада. А вовсе не потому, что меня бесит бессменный вождь на посту президента и результаты его двадцатилетней деятельности. Не потому, что я патриот, который, в отличие от путриотов хочет, чтобы было "как во Франции", Германии или Англии, а не в Зимбабве или Северной Корее. Чтобы те, кто лечатся и учат детей в указанных Германии и Великобритании, не обездоливали мою страну. Не обращайте на меня внимания.

@Светлана Гильдеева Хорошо, допустим, но тогда почему бы властям не обсуждать все честно и открыто? Не вставляя обнуление "мелким шрифтом" среди прочих поправок и старательно умалчивая об этой полезной инициативе? Напрямую, с экранов: наш Президент прекрасно показал себя на этом посту, и несправедливо, что такой успешный политический деятель лишён возможности продолжить начатое, и тп. Поправка-то немаловажная. Уж никак не менее важная, чем русский язык или защита животных. Но её хотят принять как будто "под шумок", стыдливо пряча за памятью предков и союзом мужчины и женщины. 
И почему голосовать за поправки надо непременно пакетом? Как в СССР: хочешь купить хорошую книгу?  Тогда бери внагрузку пять томов решений съездов партии.

 Всё это в целом совсем непохоже на честную игру. А для чего бы играть нечестно, если твое дело правое?

@Светлана Гильдеева Вы подменяете понятия и совсем не хотите думать. Навальный назвал продажными людей, снявшихся в ролике и агитирующих за обнуление, причём не прямо, как это сделала Терешкова, а прикрываясь вроде бы хорошими и полезными вещами. Простите за грубую метафору, маскируя яд кусочком колбасы. Одно это уже вызывает возмущение. И отвращение к этой лживой кампании и её участникам. 

Навальный обозвал людей молодых (или не очень молодых, как Бокерия и Лановой, но) сознательных, прекрасно понимающих, что они призывают народ поддержать узурпацию власти. Возможно, ему следовало сделать особую оговорку насчёт ветерана - вот он-то вряд ли в полной мере сознает, в чём подлинная суть всей этой акции, в которой его привлекли участвовать. Да и в любом случае в его возрасте ему вполне простительна лояльность к власти и доверие к ней. У человека в 93 года мировоззрение давно сформировалось, а доступ к информации несколько отличается от такового у людей в 33 и даже в 63.
Но какой удобный случай в очередной раз демонизировать Навального! И вся эта сенсация - "НАВАЛЬНЫЙ ОСКОРБИЛ ВЕТЕРАНА!" - чистой воды передёргивание и только показывает, что в путинской России  ветеранами торгуют оптом и в розницу.

@Николай Бабак не знаю какие у вас отношения с родными,но я за своего деда(который погиб под Москвой, и я его никогда не видела)снесла бы головы всем!И внук поступил правильно,жаль ,но леша опять отделяется лёгким испугом.За него обычно сидят и отдуваются другие.За оскорбления надо бить ,и жёстко. 
На этом разговор считаю законченным,каждый останется при своём мнении.
Одно пожелание вам,чтоб никто и никогда не унижал ваших родных.Удачи.
